import { PrismaClient } from '@prisma/client'
const prisma = new PrismaClient();
async function main() {
    await prisma.product.create({
        data: {
            "name":"New Balance Men's 410 Trail Running Shoe ",
            "description":"New Balance 410",
            "image":"data:image/jpeg;base64,"        },
    });
    await prisma.product.create({
        data: {
            "name":"Amazfit Gtr Smartwatch with",
            "description":"Amazfit GTR comes in a classic design with a touch of modern features. It has a brilliant 1.2” AMOLED display, and a gallery of watch faces to choose from to fit any style. Smart",
            "image":"data:image/jpeg;base64,"        },
    });
    await prisma.product.create({
        data: {
            "name":"SAMSUNG Galaxy S21 FE 5G Cell Phone",
            "description":"DUSK 'TIL DAWN ON ONE CHARGE: Get the power you need for the activities you heart the most with a smart battery that keeps you going all day and into the night.",
            "image":"data:image/jpeg;base64,"        },
    });
    // console.log({ alice })
}
main()
    .then(async () => {
        await prisma.$disconnect()
    })
    .catch(async (e) => {
        console.error(e)
        await prisma.$disconnect()
        process.exit(1)
    })
